// import logo from "./logo.svg";
import "./App.css";
import Card from "./comonents/Card.js";
import ExpenseItem from "./comonents/ExspenseItem";

function App() {
  const expenses = [
    { title: "kckc", amount: 27, date: new Date(2021, 2, 12) },
    { title: "kckc", amount: 27, date: new Date(2021, 2, 12) },
    { title: "kckc", amount: 27, date: new Date(2021, 2, 12) },
  ];
  return (
    <Card>
      <ExpenseItem
        title={expenses[0].title}
        amount={expenses[0].amount}
        date={expenses[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[0].title}
        amount={expenses[0].amount}
        date={expenses[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[0].title}
        amount={expenses[0].amount}
        date={expenses[0].date}
      ></ExpenseItem>
    </Card>
  );
}
export default App;
